import "./blog.css";
import React from "react";

const Blog = () => {
  return (
    <div className="gpt3__blog section__padding" id="blog">
      <div className="gpt3__blog-heading">
        <h1 className="gradient__text"></h1>
      </div>
    </div>
  );
};

export default Blog;
